eval("\nmodule.exports.blogs = [\n    {\n        id: {\n            en: \"1\",\n            ar: \"1\"\n        },\n        img: {\n            en: \"/findHouseReal/assets/images/home/450_1.png\",\n            ar: \"/findHouseReal/assets/images/home/450_1.png\"\n        },\n        postMeta: {\n            en: \"Contracting\",\n            ar: \"المقاولات\"\n        },\n        title: {\n            en: `Contracting`,\n            ar: ` المقاولات`\n        },\n        posterAvatar: {\n            en: \"/findHouseReal/assets/images/property/pposter1.png\",\n            ar: \"/findHouseReal/assets/images/property/pposter1.png\"\n        },\n        posterName: {\n            en: \"Ali Tufan\",\n            ar: \"علي توفان\"\n        },\n        postedDate: {\n            en: \"7 August 2022\",\n            ar: \"7 August 2022\"\n        },\n        postDescriptions: {\n            en: `Dar Farha Company started working in the construction and contracting sector since 2004, and during this period it implemented many projects in both Egypt and Saudi Arabia, and the company has a large business precedent.`,\n            ar: `بدأت شركة دار فرحة العمل في قطاع الإنشاءات والمقاولات منذ عام 2004، وخلال هذه الفترة قامت بتنفيذ العديد من المشاريع في كلا من مصر والسعودية، وتمتلك الشركة سابقة أعمال كبيرة.`\n        },\n        p1: {\n            en: \"What is meant by building contracting?\",\n            ar: \"ما المقصود بمقاولات البناء؟\"\n        },\n        p2: {\n            en: \"Executing a project according to the specifications and plans agreed upon between the contractor and the owner based on a contract of agreement between the two parties, which is called the contracting contract. The owner pays agreed amounts to the contractor, provided that the project is delivered in the agreed form.\",\n            ar: \"تنفيذ مشروع طبقا للمواصفات والمخططات المتفق عليها بين المقاول والمالك بناء على عقد اتفاق بين الطرفين وهو ما يسمى عقد المقاولة يقوم المالك بدفع مبالغ متفق عليها الى المقاول على ان يتم تسليم المشروع بالشكل المتفق عليه\"\n        },\n        p3: {\n            en: \"What are the types of building contracting contracts?\",\n            ar: \"ما هي انواع عقود مقاولات البناء ؟\"\n        },\n        p4: {\n            en: \" Major works contracts with materials. The contractor bears the materials such as cement, iron, etc Contracts for bone works without materials, such as carpentry contracts - blacksmithing - casting Turnkey business contracts that include all work stages from feasibility study - design - contracting - implementation - delivery Contracts for supervision and follow-up works, whether bone works - turnkey - supervision by sight The contracting sector represents the executive arm of the state's projects and its ambitious plan to achieve integrated urban development and launch new cities, as well as its directions to maximize existing investments in infrastructure projects, which are the cornerstone for attracting new investments and raising growth rates in the country. He is responsible for implementing major projects that have contributed to creating new job opportunities and revitalizing the movement of more than 90 industries directly related to contracting activity, in addition to redrawing Egypt on the investment map.\",\n            ar: `      تنفيذ مشروع طبقا للمواصفات والمخططات المتفق عليها بين المقاول والمالك بناء على عقد اتفاق بين الطرفين وهو ما يسمى عقد المقاولة يقوم المالك بدفع مبالغ متفق عليها الى المقاول على ان يتم تسليم المشروع بالشكل المتفق عليه\n      عقود اعمال عظم بالمواد يتحمل المقاول المواد من اسمنت - حديد ... الخ\n      عقود اعمال عظم  بدون مواد مثل  عقود النجارة – الحدادة – الصب\n      عقود اعمال تسليم مفتاح تشمل جميع مراحل العمل من دراسة جدوى - التصميم - التعاقد-  التنفيذ- التسليم\n      عقود اعمال الاشراف والمتابعة سواء اعمال العظم – تسليم المفتاح – الاشراف بالطلعة\n      يُمثل قطاع المقاولات الذراع التنفيذية لمشروعات الدولة وخطتها الطامحة لتحقيق تنمية عمرانية متكاملة وتدشين مدن جديدة، فضلا عن توجهاتها لتعظيم الاستثمارات القائمة بمشروعات البنية التحتية والتى تعد حجر الأساس لجذب الاستثمارات الجديدة ورفع معدلات النمو بالدولة، ويتولى قطاع المقاولات قيادة حركة التنمية بالدولة خلال الوقت الراهن حيث يقع على عاتقه تنفيذ المشروعات الكبرى والتى ساهمت فى خلق فرص عمل جديدة وتنشيط حركة أكثر من 90 صناعة ترتبط مباشرة بنشاط المقاولات، بجانب إعادة رسم مصر على خريطة الاستثمارات.`\n        },\n        p5: {\n            en: `The sector experts considered that the stability of the country's financial policies and high growth indicators are the main base for the growth of the construction industry in the country during the coming years, stressing that the contracting sector is currently playing a major role in redrawing the country's image and enabling it to achieve its goals in attracting foreign investments, as the sector is currently implementing a package of Infrastructure projects in addition to major road works and various housing projects, as well as the development of new cities within the state's plan to increase the urban area.\n      \n      It is worth noting that the Egyptian contracting sector is the key to the recovery of the Egyptian economy and achieving the highest rates of development since the January 25 revolution, and until now, it is the only sector that has not been affected by political or security events.\n      \n      In addition, the national projects contributed to providing an unprecedented volume of work for all contracting companies, and all studies confirm the continued leadership of the contracting sector in the Egyptian economy during the coming period.\n      \n      The state has put the issue of Egyptian exports and its repercussions during the coming years as a priority for its plan to provide liquidity from foreign currencies, and reduce the import bill that affects the overall growth and development movement, which the political leadership and the government seek to achieve in various aspects of Egypt. It has strong opportunities for export, in Africa and the Arab countries, is the contracting sector, which imposed itself years ago on the export map to them, due to its distinction and honorable and strong performance in infrastructure work and comprehensive urban development, which has become the talk of the whole world, which supports the sector and makes it the most demanded.\n      \n      And as a continuation of this success in Egypt, and exporting it to these countries, especially in light of the President’s directives, the necessity of paying attention to cooperation and achieving economic integration with the African continent and the Arab countries, in light of Egypt’s pioneering and pivotal role in the two regions. Dar Farha Company seeks to keep pace with the rapid developments in the contracting sector, noting that the company has many large projects in the Egyptian Republic and the Kingdom of Saudi Arabia.\n      \n      Since 2004, the company has gained the trust of its customers in Egypt and the Arab world, as the company provides its services based on the trust, credibility and transparency of customers in all the work it carries out.\n      \n      It always strives to be the best choice for clients in the contracting sector`,\n            ar: `\n      واعتبر خبراء القطاع أن استقرار السياسات المالية بالدولة وإرتفاع مؤشرات النمو القاعدة الرئيسية لتنامى حركة صناعة التشييد بالدولة خلال الأعوام المقبلة، مؤكدين أن قطاع المقاولات يقوم حاليا بدور رئيسى فى إعادة رسم صورة الدولة وتمكينها من أهدافها فى جذب الاستثمارات الأجنبية، حيث يتولى القطاع حاليا تنفيذ حزمة من مشروعات البنية التحتية بجانب أعمال الطرق الكبرى ومشروعات الاسكان المتنوعة، فضلا عن تنمية المدن الجديدة ضمن خطة الدولة لزيادة الرقعة العمرانية\n      \n      ومن الجدير بالذكر ان قطاع المقاولات المصري هو كلمة السر في تعافى الاقتصاد المصري وتحقيق أعلى معدلات تنمية منذ ثورة 25 يناير، وحتى الآن، فهو القطاع الوحيد الذي لم يتأثر بالأحداث السياسية أو الأمنية.\n      \n      بالإضافة لإن المشروعات القومية ساهمت في توفير حجم عمل غير مسبوق، لكافة شركات المقاولات، وكافة الدراسات تؤكد استمرار قيادة قطاع المقاولات للاقتصاد المصري خلال الفترة المقبلة.\n      \n      وضعت الدولة قضية الصادرات المصرية ومضاعفاتها خلال السنوات المقبلة كأولوية لمخططها في توفير سيولة من العملات الأجنبية ، والحد من فاتورة الاستيراد التي تؤثر على حركة النمو والتنمية الشاملة ، التي تسعى القيادة السياسية والحكومة لتحقيقها في مختلف نواحي مصر، ومن هذه القطاعات التي تكتسب أهمية كبرى بما يحظى به من فرص قوية للتصدير ، في إفريقيا والدول العربية ، هو قطاع المقاولات ، الذى فرض نفسه منذ سنوات على خريطة التصدير إليهم، نظرا لتميزه وأدائه المشرف والقوى في أعمال البنية التحتية والتنمية العمرانية الشاملة والتي أصبحت حديث العالم أجمع ، مما يدعم القطاع ويجعله الأكثر طلبا .\n      \n      واستكمالا لهذا النجاح الواقع في مصر، وتصديره لهذه الدول خاصة في ظل توجيهات الرئيس بضرورة الاهتمام بالتعاون، وتحقيق التكامل الاقتصادي مع القارة الإفريقية والدول العربية، في ظل دور مصر الريادي والمحوري بالمنطقتين. تسعي شركة دار فرحة الي مواكبة التطورات السريعة في قطاع المقاولات، علما بأن للشركة العديد من المشروعات الكبيرة في الجمهورية المصرية والمملكة العربية السعودية.\n      \n      وقد اكتسبت الشركة منذ عام 2004 ثقة عملائها في مصر والوطن العربي حيث تقدم الشركة خدماتها بناء على الثقة والمصداقية والشفافية من العملاء في كل الاعمال التي تقوم بتنفيذها\n      \n      وتسعي دائما لتكون أفضل اختيار للعملاء في قطاع المقاولات`\n        }\n    },\n    {\n        id: {\n            en: \"2\",\n            ar: \"2\"\n        },\n        img: {\n            en: \"/findHouseReal/assets/images/home/450_2.png\",\n            ar: \"/findHouseReal/assets/images/home/450_2.png\"\n        },\n        postMeta: {\n            en: \"business\",\n            ar: \"عمل\"\n        },\n        title: {\n            en: `the Real Estate`,\n            ar: `العقارات`\n        },\n        posterAvatar: {\n            en: \"/findHouseReal/assets/images/property/pposter1.png\",\n            ar: \"/findHouseReal/assets/images/property/pposter1.png\"\n        },\n        posterName: {\n            en: \"Ali Tufan\",\n            ar: \"علي توفان\"\n        },\n        postedDate: {\n            en: \"7 August 2022\",\n            ar: \"7 August 2022\"\n        },\n        p1: {\n            en: \"Real estate marketing is one of the applied branches of marketing science\",\n            ar: \"يعتبر التسويق العقاري أحد الفروع التطبيقية لعلم التسويق\"\n        },\n        p2: {\n            en: `Marketing science is considered one of the basic sciences in management sciences. And his contribution to the success of the real estate companies’ business is one of the things that is recognized by everyone, so successful real estate marketing leads to better results, as it aims to satisfy customers, in addition to that it leads to achieving the highest profits for real estate companies.\n      The real estate marketing process is also defined as the market that contains lists of properties that are bought and then sold to those interested`,\n            ar: `ويعتبر علم التسويق من العلوم الأساسية في علوم الإدارة؛ وإسهامه في نجاح أعمال الشركات العقارية من الأمور المعترف بها من قبل الجميع، إذاً التسويق العقاري الناجح يؤدي إلى نتائج أفضل، فهو يهدف إلى إرضاء الزبائن، فضلاً عن أنه يؤدي إلى تحقيق أعلى الأرباح للشركات العقارية.\n\n      كما تُعرّف عملية التسويق العقاري بأنها السوق الذي يحتوي على قوائم العقارات التي يتم شراؤها ثُم بيعها للمهتمين`\n        },\n        p3: {\n            en: \"Real estate marketing steps:\",\n            ar: \"خطوات التسويق العقاري:\"\n        },\n        p4: {\n            en: `\n      Real estate marketing steps:\n\nDetermine the marketing goal.\nDrafting a communication offer.\nDetermine the marketing method.\nFind potential clients.\nComplete the deal.\n      `,\n            ar: `تحديد هدف التسويق.\n      صياغة عرض التواصل.\n      تحديد أسلوب التسويق.\n      إيجاد العملاء المحتملين.\n      إتمام الصفقة.\n      `\n        },\n        p5: {\n            en: `Real estate development and real estate investment are among many concepts that many people confuse, although each has different terms, style, and function.\n\n      real estate development\n      \n      It is a type of business that includes activities ranging from buying old real estate, then carrying out renovations on these real estate, then selling or renting them. Real estate developers are turning the desert into cosmopolitan cities. Real estate development is considered the most general and comprehensive concept in the field of real estate, because it is defined as the process through which the value of the property is raised to come up with successful real estate units that are commensurate with the needs of the community and benefit the developer.Real estate development and real estate investment are among many concepts that many people confuse, although each has different terms, style, and function.\n\n      real estate development\n      \n      It is a type of business that includes activities ranging from buying old real estate, then carrying out renovations on these real estate,\n       then selling or renting them. Real estate developers are turning the desert into cosmopolitan cities. Real estate development is considered the most general and comprehensive concept in the field of real estate, because it is defined as the process through which the value of the property is raised to come up with successful real estate units that are commensurate with the needs of the community and benefit the developer.\n       Real estate development steps:\n       \n       Study the project idea.\n       Preparing ideas related to project implementation.\n       Idea crystallization stage.\n       and locate.\n       And the work of financial studies, and initial designs.\n       Real Estate Investment:\n       \n       It is one of the patterns of legal dispositions on real estate, as this is done either by buying and selling, renting, or partnerships in order to produce a real estate investment product, even if in the form of changing the shape of the property.\n       \n       Investing in real estate is the sound financial decision that generates income and great wealth over time, as real estate and real estate investment provide great stability compared to other investments such as stocks or bank certificates and bonds.\n       \n       Real estate investment provides an opportunity to build market share and long-term wealth.\n       \n       Real estate investment helps hedge against continuous inflation, as the real estate field is growing rapidly and provides many opportunities for economic growth and wealth building.\n       \n       It is worth noting that Dar Farha has a history full of successes in the field of real estate investment.\n       \n       Dar Farha has earned the trust of its customers and has a team of experts in the field of investment, development and real estate marketing.`,\n            ar: `التطوير العقاري والاستثمار العقاري ضمن الكثير من المفاهيم التي يخلط بينها الكثير من الناس على الرغم من أن لكل منهما شروط ونمط ووظيفة مختلفة.\n\n      التطوير العقاري\n      \n      هو نوع من الأعمال التجارية التي تشمل أنشطة تتراوح بين شراء العقارات القديمة ثم القيام بعمليات التجديد على هذه العقارات ثم بيعها او تأجيرها، ويشمل التطوير العقاري أيضاً شراء الأراضي الخالية والقيام ببناء عقارات فيها وتحويل الرسومات والأفكار التي على الورق الى عقارات ومدن على أرض الواقع، فبعض المطورين العقارين يقوموا بتحويل الصحراء الى مدن عالمية. التطوير العقاري يعتبر المفهوم الأعم والأشمل في مجال العقارات، لأنه يعرف على أنه العملية التي يتم من خلالها رفع قيمة العقار للخروج في النهاية بوحدات عقارية ناجحة تتناسب مع احتياجات المجتمع وتعود بالنفع على المطور.خطوات التطوير العقاري:\n\n      دراسة فكرة المشروع.\n      إعداد الأفكار المتعلقة بتنفيذ المشروع.\n      مرحلة بلوَرة الفكرة.\n      وتحديد الموقع.\n      وعمل الدراسات المالية، والتصاميم المبدئية.\n      الاستثمار العقاري:\n      \n      هي إحدى أنماط التصرفات القانونية على العقارات حيث يتم ذلك إما بالبيع والشراء أو الإيجار أو الشراكات من أجل إخراج ناتج عقاري استثماري حتى ولو في قالب تغيير شكل العقار.\n      \n      الاستثمار في العقارات هو القرار المالي السليم الذي يدر دخلا وثروة كبيرة مع مرور الوقت، حيث توفر العقارات والاستثمار العقاري استقرارا كبيرا مقارنة بالاستثمارات الأخرى مثل الأسهم او الشهادات البنكية والسندات.\n      \n      ويوفر الاستثمار العقاري فرصة لبناء حصة سوقية وثروة طويلة الأمد.\n      \n      الاستثمار العقاري يساعد على التحوط ضد التضخم المستمر، حيث ينمو مجال العقارات بسرعة ويوفر الكثير من الفرص للنمو الاقتصادي وبناء ثروة.\n      \n      ومن الجدير بالذكر ان لشركة دار فرحة تاريخ حافل بالنجاحات في مجال الاستثمار العقاري.\n      \n      وقد استحقت شركة دار فرحة ثقة عملائها ولديها فريق من الخبراء في مجال الاستثمار والتطوير والتسويق العقاري.`\n        },\n        postDescriptions: {\n            en: `Dar Farha provides design and implementation services for all interior decoration works`,\n            ar: `تقدم شركة دار فرحة خدمات تصميم وتنفيذ جميع أعمال الديكور الداخلي\n      والتشطيبات`\n        }\n    },\n    {\n        id: {\n            en: \"3\",\n            ar: \"3\"\n        },\n        img: {\n            en: \"/findHouseReal/assets/images/home/450_3.png\",\n            ar: \"/findHouseReal/assets/images/home/450_3.png\"\n        },\n        postMeta: {\n            en: \"business\",\n            ar: \"عمل\"\n        },\n        title: {\n            en: `We feature new Decorations`,\n            ar: `نتميز بديكورات جديده`\n        },\n        posterAvatar: {\n            en: \"/findHouseReal/assets/images/property/pposter1.png\",\n            ar: \"/findHouseReal/assets/images/property/pposter1.png\"\n        },\n        posterName: {\n            en: \"Ali Tufan\",\n            ar: \"علي توفان\"\n        },\n        postedDate: {\n            en: \"7 August 2022\",\n            ar: \"7 August 2022\"\n        },\n        postDescriptions: {\n            en: `Decoration and interior design\n      Studies have shown that the internal coordination of the house is able to change the mood, and is even able to control the feelings we feel such as happiness, depression and romance, so whoever does not feel happy enough in his home should think about redesigning it again.\n      \n      The importance of interior design lies in making the best use of the space available for the place based on the functionality and professionalism of the design. Here are the most important points that explain the importance of interior design: Making the most of the available spaces A properly designed house will provide better space, especially when it comes to the living room. In addition to facilitating a measure of open space in the house. This will eliminate aspects of unnecessary crowding and those common in poorly designed homes. Cost saving and easy maintenance.`,\n            ar: `الديكور والتصميم الداخلي\n      أثبتت الدراسات أن التنسيق الداخلي للمنزل قادر على تغيير المزاج، بل وقادر على التحكم فيما نشعر به من أحاسيس مثل السعادة والاكتئاب والرومانسية، لذلك من لا يشعر بالسعادة الكافية في منزله يجب التفكير في إعادة تصميمه من جديد.\n      \n      تكمن أهمية التصميم الداخلي في استغلال المساحة المتاحة للمكان بأفضل شكل بناءً على الوظيفة واحترافية التصميم. وفيما يأتي أهم النقاط التي تشرح أهمية التصميم الداخلي: تحقيق أقصى استفادة من المساحات المتاحة سيوفر المنزل المصمم بشكل صحيح مساحة أفضل خاصة عندما يتعلق الأمر بغرفة المعيشة. بالإضافة إلى تسهيل قدر من المساحة المفتوحة في المنزل. سيؤدي ذلك إلى القضاء على جوانب الازدحام غير الضروري وتلك الشائعة في المنازل ذات التصميم السيئ. توفير التكاليف وسهولة الصيانة.`\n        },\n        p2: {\n            en: `\n      Investing in a good interior design adds value in the long run, as an interior designer is well aware of the types of fixtures, lighting, curtains, paint, sofa designs, and rugs that you should place in different parts of the house. A good interior designer will also help you save on costs by helping you choose the best materials, fixtures, and furniture that you can afford with your current budget.\n      \n      The importance of interior design also lies in its ability to improve user experience by managing home and office spaces in better ways, and improving the space in the internal environment so that it is harmonious and consistent with its purposes. For example, if you are an interior designer working on developing the work environment in the office, you will make the design help employees to be productive, focus and increase the level of job performance. If you are designing bedrooms, your main goal will be to provide a more relaxing and comfortable environment.`,\n            ar: ` الاستثمار في التصميم الداخلي الجيد يضيف قيمة على المدى الطويل، حيث يدرك المصمم الداخلي جيدًا أنواع التركيبات والإضاءة والستائر والطلاء وتصميمات الأرائك والسجاد التي يجب أن تضعها في أجزاء مختلفة من المنزل. كما سيساعدك المصمم الداخلي الجيد على توفير التكاليف من خلال مساعدتك في اختيار أفضل المواد والتجهيزات والأثاث الذي يمكنك تحمله بميزانيتك الحالية.\n\n      وتكمن أيضا أهمية التصميم الداخلي في قدرته على تحسين تجربة المستخدم من خلال إدارة المساحات المنزلية والمكتبية بطرقٍ أفضل، وتحسين المساحة في البيئة الداخلية بحيث تكون متناغمة ومتناسقة مع أغراضها. فعلى سبيل المثال، إذا كنت مصممًا داخليًا وتعمل على تطوير بيئة العمل في المكتب، فإنك ستجعل التصميم يساعد الموظفين على الإنتاجية والتركيز ورفع مستوى الأداء الوظيفي. أما إذا كنت تصمم غرفًا للنوم، فإن هدفك الأساسي سيكون العمل على توفير بيئة أكثر استرخاءً وراحة.`\n        },\n        p1: {\n            en: `Studies have shown that the internal coordination of the house is able to change the mood, and is even able to control the feelings we feel such as happiness, depression and romance, so whoever does not feel happy enough in his home should think about redesigning it again.\n\n      The importance of interior design lies in making the best use of the space available for the place based on the functionality and professionalism of the design. Here are the most important points that explain the importance of interior design: Making the most of the available spaces A properly designed house will provide better space, especially when it comes to the living room. In addition to facilitating a measure of open space in the house. This will eliminate aspects of unnecessary crowding and those common in poorly designed homes. Cost saving and easy maintenance.`,\n            ar: `أثبتت الدراسات أن التنسيق الداخلي للمنزل قادر على تغيير المزاج، بل وقادر على التحكم فيما نشعر به من أحاسيس مثل السعادة والاكتئاب والرومانسية، لذلك من لا يشعر بالسعادة الكافية في منزله يجب التفكير في إعادة تصميمه من جديد.\n\n      تكمن أهمية التصميم الداخلي في استغلال المساحة المتاحة للمكان بأفضل شكل بناءً على الوظيفة واحترافية التصميم. وفيما يأتي أهم النقاط التي تشرح أهمية التصميم الداخلي: تحقيق أقصى استفادة من المساحات المتاحة سيوفر المنزل المصمم بشكل صحيح مساحة أفضل خاصة عندما يتعلق الأمر بغرفة المعيشة. بالإضافة إلى تسهيل قدر من المساحة المفتوحة في المنزل. سيؤدي ذلك إلى القضاء على جوانب الازدحام غير الضروري وتلك الشائعة في المنازل ذات التصميم السيئ. توفير التكاليف وسهولة الصيانة.`\n        },\n        p3: {\n            en: `Dar Farha works in the field of decoration engineering and interior design\n\n      There is a clear difference between interior design and interior design as two important sectors of interior design departments, that creative field that works on the artistic and creative sense\n      \n      The interior design profession is known as including many modern mechanisms and technologies, as its implementation is based on technical solutions inside buildings in a way that suits the objectives of the project, by applying many methods, researches and analyzes that work to create an organized internal environment, and it also works to achieve Comfortable living style.`,\n            ar: `تعمل شركة دار فرحة في مجال هندسة الديكور والتصميم الداخلي\n\n      هناك فرق واضح بين هندسة الديكور والتصميم الداخلي كقطاعين هامين من أقسام هندسة الديكور ذلك المجال الإبداعي الذي يعمل على الحس الفني والإبداعي\n      \n      - تعرف مهنة التصميم الداخلي بأنها تشتمل على العديد من الآليات والتقنيات الحديثة، حيث يتم الاعتماد في تنفيذها على الحلول التقنية داخل المباني بما يناسب أهداف المشروع، وذلك عن طريق تطبيق الكثير من المناهج والأبحاث والتحاليل التي تعمل على إيجاد بيئة داخلية منظمة، كما تعمل على تحقيق نمط معيشي مريح.`\n        },\n        p4: {\n            en: `Interior design is concerned with everything related to human behavior and interaction within the place, while the interior design is concerned with distributing and beautifying furniture in the place with the help of several creative elements of an innovative shape.\n\n \n\n      Interior designers work to provide a distinctive shape for the finishing materials, and choose good quality that can withstand, and work must be done to choose the most durable types of them, as well as sound insulation on the walls, as for the floors, the interior designer must choose the flooring materials that are suitable for the space, as well It should not be combustible, and the distribution of bathroom sets to rooms, the optimal distances between bathroom elements, securing safety elements, and choosing surfaces that avoid individuals from slipping and avoiding sharp corners that may cause harm to their users, are determined.\n      \n      As for the furniture, the interior designer is able to determine the appropriate spaces between the pieces of furniture, which must then take into account the boundaries between them, so he distributes them appropriately in the house. In order to ventilate and prevent moisture and rot in the rooms and the ability of this type of curtains to sound insulation and avoid fires.\n      \n      The interior designer must be interested in making and presenting plans for determining the locations of lighting devices and switches for that, and the numbers and sizes of each of them, as well as lighting effects, presenting the design idea and ensuring that it gives an aesthetic of some kind to the place. He must also be concerned with health considerations in terms of the characteristics of combustion of interior materials.`,\n            ar: `- يهتم التصميم الداخلي بكل ما يتعلق بسلوكيات الإنسان وتفاعله داخل المكان، أما هندسة الديكور فتهتم بتوزيع الأثاث في المكان وتجميله مع الاستعانة بعدة عناصر إبداعية ذات شكل مبتكر.\n\n \n\n      يعمل مصممي الديكور على تقديم شكل مميز لمواد التشطيب، واختيار نوعية جيدة يمكنها التحمل، كما يجب العمل على اختيار الأنواع الأكثر متانة منها، وكذلك وضع عزل للصوت على الجدران، أما الأرضيات فيجب أن يقوم المصمم الداخلي على اختيار مواد الأرضيات والتي تكون ملاءمة للمساحة، كما يجب ألا تكون لها قابليه للاحتراق، ويتم تحديد توزيع أطقم الحمامات على الغرف، والمسافات المثلى بين عناصر الحمام، وتأمين عناصر السلامة واختيار الأسطح التي تجنب الأفراد الانزلاق وتجنب الزوايا الحادة التي قد تسبب حدوث الضرر لمستخدميها.\n      \n      أما بالنسبة للأثاث فالمصمم الداخلي هو القادر على تحديد الفراغات المناسبة بين قطع الأثاث والتي يجب عندها مراعاة الحدود بينها فيقوم بتوزيعها بشكل مناسب في المنزل، كما يعمل المصمم على اختيار الشكل الداخلي من أثاث مثل الشكل الأنسب للستارة، والذي يجب أن يأمن دخول الشمس إلى الغرف من أجل التهوية ومنع الرطوبة والتعفن في الغرف ومدى قدرة هذه النوعية من الستائر على العزل الصوتي وتجنب الحرائق.\n      \n      ويجب أن يهتم المصمم الداخلي بعمل وتقديم مخططات خاصة بتحديد أماكن أجهزة الإنارة والمفاتيح الخاصة بذلك وأعداد كل منها ومقاساتها، وكذلك المؤثرات الضوئية وتقديم فكرة التصميم والحرص على جعلها تضفي جمالية من نوع ما للمكان، كما يجب أن يهتم بالاعتبارات الصحية من ناحية خصائص احتراق المواد الداخلية.`\n        },\n        p5: {\n            en: `Types of interior design\n\n      modern\n      \n      traditional\n      \n      contemporary\n      \n      industrial\n      \n      transitional\n      \n      rural\n      \n      bohemian\n      \n      Interior Design:\n      \n      It works to pay attention to the decoration and its aesthetic aspect, and also pays attention to the structural capacity of the building materials, their age, and the best shape for every detail of the house details such as handles and drawers, but some things must be taken into account such as the sizes and mathematical proportions of building patterns, the finishing elements of walls, floors, bathrooms, their texture and appropriate colors For each room according to its nature.\n      \n      The decorator must be concerned with choosing the floors, the quality of the tiles and ceramics used in them, their shape, type, and colors. The decorator also chooses on the basis of the general aesthetic perspective. For this, the decorator does not start work without obtaining the general plans of the site accompanied by explanatory charts, and the arrangement of furniture must be among the tasks The decorator covers the windows in an aesthetic way that suits the degree of sunshine and shadows. The decorator must also choose the type of fabric for mattresses, sofas and bedrooms, and the appropriate number of meters for each room.\n      \n      It is important to mention that Dar Farha Company has a distinguished and elegant work in the field of decoration engineering and interior design`,\n            ar: `انواع التصميم الداخلي\n\n      عصري\n      \n      تقليدي\n      \n      معاصر\n      \n      صناعي\n      \n      انتقالي\n      \n      ريفي\n      \n      البوهيمي\n      \n      هندسة الديكور:\n      \n      تعمل على الاهتمام بالديكور وبالناحية الجمالية له، كما تعمل على الاهتمام بالقدرة الإنشائية لمواد البناء، وعمرها، والشكل الأفضل لكل تفصيله من تفاصيل المنزل مثل المقابض والأدراج، ولكن يجب مراعاة بعض الأشياء مثل الأحجام والنسب الرياضية لأنماط البناء، عناصر تشطيب الجدران والأرضيات والحمامات وملمسها والألوان المناسبة لكل غرفة بحسب طبيعتها.\n      \n      ويجب أن يهتم مهندس الديكور باختيار الأرضيات ونوعية البلاط والسيراميك المستخدم فيها وشكله ونوعه وألوانه، كما يقوم مهندس الديكور بالاختيار على أساس المنظور الجمالي العام لهذا لا يبدأ مهندس الديكور بالعمل بدون الحصول على المخططات العامة للموقع مرفقة بمخططات توضيحية، ويجب أن يقع ترتيب الأثاث من ضمن مهمات مهندس الديكور ويقوم بتغطية النوافذ بطريقة جمالية تناسب درجة سقوط الشمس والظلال، كما يجب أن يختار مهندس الديكور نوع القماش للفرش والكنب وغرف النوم، وعدد الأمتار المناسبة لكل غرفة.\n      \n      من المهم ذكر ان لشركة دار فرحة سابقة اعمال مميزة وانيقة في مجال هندسة الديكور والتصميم الداخلي .`\n        }\n    }, \n];\nmodule.exports.blogsLinks = [\n    {\n        id: {\n            en: \"Contracting\",\n            ar: \"المقاولات\"\n        },\n        nav1: {\n            en: \"Contracting\",\n            ar: \"المقاولات\"\n        }\n    },\n    {\n        id: {\n            en: \"Decorations\",\n            ar: \"ديكورات\"\n        },\n        nav3: {\n            en: \"Decorations\",\n            ar: \" ديكورات \"\n        }\n    },\n    {\n        id: {\n            en: \"Real Estate\",\n            ar: \"العقارات\"\n        },\n        nav2: {\n            en: \"Real Estate\",\n            ar: \"العقارات\"\n        }\n    }, \n];\nmodule.exports.blogname = {\n    en: `The house is soft and I have to worry about it.`,\n    ar: `المنزل ناعم ولا بد لي من القلق بشأنه. `\n};\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./src/data/blogs.js\n");

